import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import FilteredList from './FilteredList';
import Dropdown from 'react-bootstrap/Dropdown';
import Checkbox from '@mui/material/Checkbox';
import FormControlLabel from '@mui/material/FormControlLabel';


export default function NavBar(props) {

  return (
    <div>
      <div>
        <Dropdown >
          <Dropdown.Toggle variant="success" id="dropdown-basic">
            Sort by
          </Dropdown.Toggle>

          <Dropdown.Menu >
            <Dropdown.Item onClick={() => {props.selectSortStyle("lth")}} eventKey="lth">Price: low to high</Dropdown.Item>
            <Dropdown.Item onClick={() => {props.selectSortStyle("htl")}} eventKey="htl">Price: high to low</Dropdown.Item>
          </Dropdown.Menu>
        </Dropdown>
      </div>
      <FormControlLabel control={
          <Checkbox 
              onChange={(event) =>
                handleAllChecked(event)
              }
              defaultChecked />
        } label="All" />
      <FormControlLabel control={
          <Checkbox 
              onChange={(event) =>
                handleFilterAChecked(event)
              }
              defaultChecked />
        } label="Filter A" />
      <FormControlLabel control={
          <Checkbox 
              onChange={(event) =>
                handleFilterBChecked(event)
              }
              defaultChecked />
        } label="Filter B" />

        {/* <Nav onSelect={props.selectFilterType}>
